import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

export default class extends Component {
  render() {
    return (
      <>
              <Navbar />
        {/* <News country="us" category='technology'/> */}
        <Router>

<Router><Switch><Route path="/business"><News country="us" category="bussiness" /></Route></Switch></Router>
<Router><Switch><Route path="/entertainment"><News country="us" category="entertainment"/></Route></Switch></Router>
<Router><Switch><Route path="/general"><News country="us" category="general"/></Route></Switch></Router>
<Router><Switch><Route path="/health"><News country="us" category="health" /></Route></Switch></Router>
<Router><Switch><Route path="/science"><News country="us" category="science" /></Route></Switch></Router>
<Router><Switch><Route path="/sports"><News country="us" category="sports" /></Route></Switch></Router>
<Router><Switch><Route path="/technology"><News country="us" category="technology" /></Route></Switch></Router>
        </Router>

      </>
    );
  }
}
